import React, { Component } from 'react'
import AdminService from '../services/AdminService'
// import DonorService from '../services/DonorService'

export default class AdminSeekersList extends Component {


	constructor(props) {
		super(props)
		this.state = this.initialState;
		this.addSeeker = this.addSeeker.bind(this);
		this.editUser = this.editUser.bind(this);
		this.logout = this.logout.bind(this);

	}

	initialState = {
		seeker: []
	}




	componentDidMount() {
		
		AdminService.getSeekers().then((res) => {
	
			this.setState({ seeker: res.data.result });
			
			console.log(this.state.seeker);
		});
	}

	addSeeker() {
		this.props.history.push('/seeker_registration');
	}

	editUser(email) {
		window.localStorage.setItem("emailId", email);
		this.props.history.push('/edit_seeker');
	}
	logout() {
		alert("Goodbye, "+this.state.seeker.firstName)
		window.localStorage.removeItem("emailId");
		console.log(this.setState(this.initialState));
		this.props.history.push('/');
	}

	deleteUser(email){
		// window.localStorage.removeItem("emailId");
		// console.log(this.setState(this.initialState));
		// DonorService.deletePersonDetails(window.localStorage.getItem("emailId")).then(
		// 	res =>{
		// 		alert("We feel sad to see you go.")
		// 			window.localStorage.removeItem("emailId");
		// 	// console.log(this.setState(this.initialState));
		// 		this.props.history.push('/');
		// 	}
		// )
		AdminService.deleteUser(email).then(res=>{
			alert("User Deleted Successfully")
			this.setState({seeker :this.state.seeker.filter(seeker=>seeker.email !==email)});
		})
		
	}

	render() {
		return (
			<div>
				<h2 className="text-center">Seeker List</h2>
				<div className="row">
					<button className="btn btn-primary" onClick={this.addDonor}>Add Seeker</button>
				</div>
				<div className="row">

					{/* <input type="text" name="email" onChange= {this.onChange}></input>
					<button onClick={this.searchByEmail}></button> */}
					<h2>Hello, Admin</h2>
					<table className="table table-stripped table-bordered">
						<thead>
							<tr>
								<th>Donor Id</th>
								<th>First Name</th>
								<th>Last Name</th>
								<th>Phone Number</th>
								<th>Age</th>
								<th>Blood Group</th>
								<th>Recovery Days</th>
								<th>City</th>
								<th>Email</th>
								<th>Action</th>
							</tr>
						</thead>
						<tbody>
							{
								this.state.seeker.map(
								seeker =>
								<tr >
									<td> {seeker.id} </td>
									<td> {seeker.firstName} </td>
									<td> {seeker.lastName} </td>
									<td> {seeker.phoneNumber} </td>
									<td> {seeker.age} </td>
									<td> {seeker.bloodGroup} </td>
									<td> {seeker.past14Days} </td>
									<td> {seeker.stateName} </td>
									<td> {seeker.email} </td>
									<td>
									<button className="btn btn-success" onClick={() => this.editUser(seeker.email)}>Edit Details</button>
									<button className="btn btn-success" onClick={() => this.deleteUser(seeker.email)}>Delete Profile</button>
									</td>
								</tr>
								)
							}
						</tbody>
						{/* <button onClick={this.editUser}>Edit Details</button>
						<button onClick={this.logout}>Logout</button>
						<button onClick={this.deleteUser}>Delete Profile</button> */}
					</table>
				</div>


			</div>
		)
	}
}
